import dotenv from 'dotenv';

dotenv.config();

export const AZURE_OPENAI_API_KEY = process.env.AZURE_OPENAI_API_KEY;
export const AZURE_OPENAI_ENDPOINT = process.env.AZURE_OPENAI_ENDPOINT;
export const AZURE_OPENAI_API_VERSION = process.env.AZURE_OPENAI_API_VERSION;

// API configuration
const API_BASE_URL = process.env.REACT_APP_API_BASE_URL || 'http://localhost:3001/api';

// Add new API endpoints
const API_ENDPOINTS = {
  // Existing endpoints
  countries: `${API_BASE_URL}/countries`,
  states: `${API_BASE_URL}/states`,
  businesses: `${API_BASE_URL}/businesses-by-encoded-title`,
  
  // New endpoint for directory businesses from dir_con_table
  directoryBusinesses: `${API_BASE_URL}/directory-businesses`,
};

export { API_BASE_URL, API_ENDPOINTS };
